(1, 'uploads/banners/V1HmW4gnJDHXfap1qiuSbY5212iMV2n8e4FftpB4.jpg', NULL, NULL, 'Buy, Sell, And Find Everisamting', '购买、出售和寻找 Everisamting', 'Achetez, vendez et trouvez Everisamting', 'Купляйце, прадавайце і знайдзіце Everisamting', 'Buy, Sell, and Find Everisamting In Vanuatu! Advertise your business, or service. Look for local events, find a job, or simply turn unwanted items into vatu!', '购买和出售从二手车到手机和电脑的一切东西，或者在世界各地寻找财产等等！', 'Achetez et vendez tout, des voitures d\'occasion aux téléphones mobiles et aux ordinateurs, ou recherchez une propriété et plus encore partout dans le monde !', 'Купляйце і прадавайце ўсё: ад патрыманых аўтамабіляў да мабільных тэлефонаў і камп\'ютараў, або шукайце нерухомасць і многае іншае па ўсім свеце!', NULL, NULL, 'Choose our membership plan to publish your ads with us', NULL, NULL, NULL, NULL, '<p><strong>Everisamting Terms of Use</strong><br>&nbsp;</p><ol><li><strong>Introduction.&nbsp;</strong>Welcome to&nbsp;www.everisamting.com. Thanks for stopping by. These Terms of Use, the Privacy Policy, the Mobile Devices Terms and all policies posted on our site set out the terms on which we offer you access to and use of our site, services, applications and tools (collectively “Services”). You can find an overview of our policies&nbsp;here&nbsp;. All policies, the Mobile Devices Terms, and the&nbsp;Privacy Policy&nbsp;are incorporated into these Terms of Use. You agree to comply with the full Terms of Use when accessing or using our Services. The Terms of Use set out below take effect from 1 July 2017. A copy of the Terms of Use in effect prior to 1 July 2017 can be located&nbsp;here.</li><li><strong>Your Account.</strong>&nbsp;To access and use some of the Services, you may need to register with us and set up an account with your email address and a password (your “Account”).&nbsp;The email address you register with will be your email address, and you are solely responsible for maintaining the confidentiality of your password. You are solely responsible for all activities that happen under your Account.</li></ol><p>You may connect to the Services with a third-party service (e.g., Facebook or Google+) and you give us permission to access, store, and use your information from that service as permitted by that service and as may be described in our Privacy Policy. If you believe your Account has been compromised or misused, contact us immediately at&nbsp;Everisamting Customer Support.&nbsp;<br>&nbsp;</p><ol><li><strong>Using Everisamting.&nbsp;</strong>To use the Services, you must be over 18 years old. You agree that you will only post in relation to goods or services in Vanuatu in the appropriate category or area and you agree that you will not do any of the following bad things:</li></ol><ul><li>violate any laws or the&nbsp;Posting Rules;</li><li>post any threatening, abusive, defamatory, obscene or indecent material;</li><li>be false or misleading;</li><li>infringe any third-party right;</li><li>distribute or send communications that contain spam, chain letters, or pyramid schemes;</li><li>distribute viruses or any other technologies that may harm Everisamting, the Services or the interests or property of Everisamting users;</li><li>impose an unreasonable load on our infrastructure or interfere with the proper working of the Services;</li><li>copy, modify, or distribute any other person’s content without their consent;</li><li>use any robot spider, scraper or other automated means to access the Services and collect content for any purpose without our express written permission;</li><li>harvest or otherwise collect information about others, including email addresses, without their consent</li><li>bypass measures used to prevent or restrict access to the Services; and/or</li><li>post an ad with the intention to profit from a natural disaster, health or public safety concern, or tragic event.</li></ul><ol><li><strong>Abusing Everisamting Services.&nbsp;</strong>Everisamting and the Everisamting community work together to keep the Services working properly and the community safe. Please report problems, offensive content and policy breaches to us using the reporting system. You are solely responsible for all information that you give to Everisamting and any consequences that may result from your posts. We can at our discretion refuse, delete or take down content that we think is inappropriate or breaching these Terms of Use. We also can at our discretion restrict a user’s usage of the Services either temporarily or permanently, or refuse a user’s registration. Without limiting other remedies, we may issue warnings, limit or terminate our Services, remove hosted content and take technical and legal steps to keep users off the Services if we think that they are creating problems or acting inconsistently with the letter or spirit of our policies. However, whether we take any of these steps, we don’t accept any liability for monitoring the Services or for unauthorized or unlawful content on the Services or use of the Services by users. You also accept that Everisamting is not under any obligation to monitor any data or content which is submitted to or available on the Services. &nbsp;​​​</li><li><strong>Global Marketplace.&nbsp;</strong>Some of the Service’s features may display your ad on other sites, like on our classifieds sites, including those&nbsp;in other countries. By using the Services, you agree that your ads can be displayed on these other sites. The terms for our other sites are similar to these terms, but you may be subject to additional laws or other restrictions in the countries where your ad is posted. When you choose to post your ad to another site, you may be responsible for ensuring that it does not violate our other site policies. We may remove your ad if it is flagged on any of our sites, or if we believe it causes problems or violates any law or policy.</li><li><strong>Fees and Services.</strong>&nbsp;Using the Services is generally free. We may sometimes charge a fee for certain features or Services. If the feature you use incurs a fee, you will be able to review and accept that charge before purchase. If you choose to pause an ad at any stage, any features you have applied to your ad will not be paused. Our fees are quoted in Vanuatu Dollars, and we may sometimes change them. We’ll notify you of changes to our fees by posting the changes on the site. We may sometimes temporarily change our fees for testing purposes, promotional events or new features, these changes take effect from the time the price change is posted to the site. Our fees are non-refundable after the feature is supplied, and you are responsible for paying them when they are due. If you don’t, we may limit your ability to use the Services. If your payment method fails or your account is past due, we may collect fees owed using collection mechanisms, including third party debt collection services. Vanuatu taxes associated with our Services will be collected where applicable. &nbsp;You agree to provide accurate information necessary for Everisamting to comply with our obligations under applicable law. &nbsp;You are solely responsible for collecting and remitting any applicable taxes resulting from the sale of your items or services listed on Everisamting’s Services.</li><li><strong>Content.&nbsp;</strong>Everisamting’s Services contain content from us, you, and other users. Everisamting is protected by copyright laws and international treaties. Content displayed on or via the Services is protected as a collective work and/or compilation, pursuant to copyrights laws and international conventions. You agree not to copy, distribute the Services or modify content from the Services, our trademarks or copyrights without our express written consent. You may not disassemble or decompile, reverse engineer or otherwise attempt to discover any source code contained in the Services. Without limiting the foregoing, you agree not to reproduce, copy, sell, resell, or exploit for any purposes any aspect of the Services (other than your own content). When you give us content, including pictures, you grant us and represent that you have the right to grant us, a non-exclusive, worldwide, perpetual, irrevocable, royalty-free, sub-licensable (through multiple tiers) right to exercise any and all copyright, publicity, trademarks, design, database and intellectual property rights to that content, in any media whether now known or to be discovered in the future, including third party sites and applications. You also waive all moral rights you have in the content to the fullest extent permitted by law. We reserve the right to remove content where we have grounds for suspecting the violation of these terms or the rights of any other party.</li><li><strong>Reporting Intellectual Property Infringements (Verified Rights Owners - VeRO).&nbsp;</strong>Do not post content that infringes the rights of third parties. This includes, but is not limited to, content that infringes on intellectual property rights such as copyright and trademark (e.g. offering counterfeit items for sale). We can remove content where we have grounds for suspecting the violation of these terms, our policies or of any party’s rights. If you have a good faith belief that a listing on any of the Services infringes your copyright, trademark, or other intellectual property rights, all you need to do is download our&nbsp;Notice of Infringement (NOCI)&nbsp;&nbsp;form, fill it out, and email it to the email address in the form. Only the intellectual property rights owner can report potentially infringing items or listings through Everisamting’s VERO Program. After we receive your first NOCI, Everisamting will confirm your enrolment in our program and send you the instructions on how to submit future reports electronically. We can share, in accordance with applicable law, the completed NOCI form with the third party that originally posted the potentially infringing listing.</li><li><strong>Third Party services on Everisamting.&nbsp;</strong>You may use the PayPal payment gateway for some financial transactions on our Services. When you link your PayPal account to your Account, you can use your PayPal account to pay or be paid for items by buyers or sellers while using Everisamting’s Services. You acknowledge and agree that by utilising any third party services through our Services (such as PayPal), you are bound by the terms and conditions of that third party and we are not liable for any loss, claims or damages howsoever arising in connection with that third party’s services.</li></ol><p>If you to link your PayPal account to your Account you appoint Everisamting as your limited agent to:</p><p>a. provide to PayPal your name, address, payment amount, item details, item category, and all other information required by PayPal to enable PayPal to process payments to or from your PayPal account; and</p><p>b. receive payment confirmation and decline notices from PayPal in respect of your PayPal payment transactions.&nbsp;</p><p><br>When you link your PayPal account to your Account, we accept our appointment as your limited agent to undertake those activities specified in the paragraph above. Our appointment as your agent to undertake these activities terminates immediately upon your Account ceasing to be linked to your PayPal account.<br><br>If you have a dispute with PayPal, a buyer, or a seller, that does not arise directly as a result of an error by Everisamting, in respect of any payment transacted (or failed to be transacted) on your PayPal Account, you release us and our affiliates (and our officers, directors, agents, subsidiaries, joint ventures and employees and those of our affiliates) from any and all claims demands and damages (actual and consequential) of every kind and nature, known or unknown, arising out of or in any way connected with such disputes.<br><br>Everisamting is not able to access your complete financial details from PayPal or your PayPal account. At no time does Everisamting hold any of the funds when a buyer pays a seller using PayPal. Funds are transferred directly by PayPal from the buyer’s PayPal account to the seller’s PayPal account after the deduction by PayPal of any relevant PayPal fees. PayPal\'s terms and conditions apply to your use of PayPal when you access PayPal’s services from our Services, and you must agree to PayPal’s terms and conditions in order to use the PayPal’s services. You acknowledge and agree that, to the extent permitted by law, we are not liable to you for any loss or damage you incur arising from your use of the PayPal method, unless such loss or damage was as a direct result of Everisamting’s error, in which case our liability is limited in accordance with clause 11.<br>&nbsp;</p><ol><li><strong>Legal and Financial&nbsp;Advice</strong>. You acknowledge and agree that you have the opportunity to obtain independent legal and financial advice from appropriately qualified professional advisers and that you take into account your personal objectives, financial situation and needs before buying or selling an item via our Services.</li></ol><p>You acknowledge and agree that the information provided by Everisamting in relation to using PayPal’s services is factual in nature only and Everisamting has not provided a recommendation or statement of opinion intended to influence your decision on whether or not to use PayPal’s services and that you cannot rely on any of Everisamting’s advertising materials, terms, instructions or policies as a recommendation, statement of opinion or financial product advice.<br>&nbsp;</p><ol><li><strong>Limitation of Liability. &nbsp;</strong>Nothing in these Terms of Use (including this clause 11) excludes, restricts or modifies any rights or statutory guarantees that you may have under applicable laws that cannot be excluded, restricted or modified, including any such rights or statutory guarantees under the Vanuatu Consumer Law.</li></ol><p>To the extent that these Terms of Use are found to exclude, restrict or modify any such rights or statutory guarantees, those rights and/or statutory guarantees prevail to the extent of the inconsistency.<br><br>Services are provided “as is” and “as available”. You agree not to hold us responsible for things other users post or do. As most of the content on the Services comes from other users, we do not guarantee the accuracy of postings or user communications or the quality, safety, or legality of what is offered. Without in any way limiting the above, you understand and agree that any seller listing which utilises the \'Price Drop\' feature has been applied at the sole discretion of that specific user for their listing. Everisamting does not in any way represent, warrant or guarantee that a price displayed for any listing on the Services which uses the Price Drop feature is a genuine price reduction.<br><br>We also cannot guarantee continuous or secure access to our Services. While we will use reasonable efforts to maintain an uninterrupted service, we cannot guarantee this and, to the extent permitted by law, we do not give any promises or warranties (whether express or implied) about the availability of our Services or that the Services will be uninterrupted or error-free. Notification functionality in the Services may not occur in real time. That functionality is subject to delays beyond our control, including without limitation, delays or latency due to your physical location or your wireless data service provider’s network.<br><br>To the extent permitted by law:</p><ul><li>we are not liable for the posting of any unlawful, threatening, abusive, defamatory, obscene or indecent information, or material of any kind by a user of the Service which violates or infringes upon your rights, including without limitation any transmissions constituting or encouraging conduct that would constitute a criminal offense, give rise to civil liability or otherwise violate any applicable law.</li><li>and without limiting any rights that you may have under the Vanuatu Consumer Law, Everisamting’s liability to you for any failure by Everisamting to comply with any statutory guarantee under the Vanuatu Consumer Law is limited to Everisamting supplying the Services again or paying you the cost of having the Services supplied again.</li></ul><p>In addition, to the extent permitted by applicable law, we (including our parent, subsidiaries, and affiliates, and our and their officers, directors, agents and employees) are not liable, and you agree not to hold us responsible, for any damages or losses (including, but not limited to, loss of money, goodwill or reputation, profits, other intangible losses, or any special, indirect, or consequential damages) resulting directly or indirectly from:</p><ul><li>the content you provide (directly or indirectly) using our Services;</li><li>your use of or your inability to use our Services;</li><li>delays or disruptions in our Services;</li><li>viruses or other malicious software obtained by accessing or linking to our Services;</li><li>glitches, bugs, errors, or inaccuracies of any kind in our Services;</li><li>damage to your hardware device from the use of any Service;</li><li>the content, actions, or inactions of third parties, including items listed using our Services;</li><li>a suspension or other action taken with respect to your account for breach or these Terms of Use or our policies;</li><li>your need to modify practices, content, or behaviour, or your loss of or inability to do business, as a result of changes to these Terms of Use or our policies.</li></ul><p><br>Everisamting excludes any liability to you for any loss or damage suffered by you as a result of Everisamting failing to comply with an applicable statutory guarantee under the Vanuatu Consumer Law if you suffering such loss or damage was not reasonably foreseeable and was not directly caused by Everisamting.<br>&nbsp;</p><ol><li><strong>Indemnification.&nbsp;</strong>You will indemnify and hold harmless Everisamting and our affiliates and our and their respective officers, directors, agents and employees (each an “Indemnified Party”), from any claim made by any third party, together with any amounts payable to the third party whether in settlement or as may otherwise be awarded, and reasonable legal costs incurred by any of the Indemnified Parties, arising from or relating to your use of the Services, any alleged violation by you of the applicable terms, and any alleged violation by you of any applicable law or regulation. We reserve the right, at our own expense, to assume the exclusive defence and control of any matter subject to indemnification by you, but doing so will not excuse your indemnity obligations.</li><li><strong>Release.&nbsp;</strong>If you have a dispute with one or more Everisamting users, you release us (and our officers, directors, agents, subsidiaries, joint ventures and employees) from any and all claims, demands and damages (actual and consequential) of every kind and nature, known or unknown, arising out of or in any way connected with such disputes.</li><li><strong>Personal Information.&nbsp;</strong>By using the Services, you agree to the collection, transfer, storage and use of your personal information by us (the “data controller”) on servers located in the United States and in the European Union as further described in our&nbsp;privacy policy.</li><li><strong>Severability.&nbsp; </strong>If a provision of these Terms of Use is illegal or unenforceable in any relevant jurisdiction, it may be severed for the purposes of that jurisdiction without affecting the enforceability of the other provisions of these Terms of Use.</li><li><strong>General.&nbsp;</strong>These Terms of Use and the other policies posted on the Services set out the entire agreement between Everisamting and you, overriding any prior agreements. From 1 July 2017, this agreement is governed by the laws of New South Wales, Vanuatu. We both submit to the non-exclusive jurisdiction of the courts of New South Wales, Vanuatu. If we don’t enforce any particular provision, we are not waiving our right to do so later. If a court strikes down any of these Terms of Use, the remaining terms will survive. We may automatically assign this agreement in our sole discretion in accordance with the notice provision below (our assignment to an affiliate will not require notice). Except for notices about illegal or infringing content, your notices to us must be sent by registered mail to:</li></ol><p>Everisamting&nbsp;</p><p>PO BOX 1515</p><p>Vanuatu</p><p>&nbsp; We will send notices to you via the email address you provide, or by registered mail. Notices sent by registered mail will be deemed received five days following the date of mailing. We may update this agreement at any time, with updates taking effect when you next use the site or after 30 days, whichever is sooner. No other amendment to this agreement will be effective unless made in writing, signed by you and by us. &nbsp; Send questions, comments or complaints to&nbsp;Everisamting Customer Support.<br>&nbsp;</p><ol><li><strong>Mobile Devices Terms.&nbsp;</strong>If you’re accessing Everisamting Services from a mobile device using a Everisamting Mobile Application (the “Application”), the following terms and conditions (“Mobile Devices Terms”) apply to you in addition to the applicable Mobile Privacy and Legal Notice or End User License Agreement, as the case may be. Your use of the Application confirms your agreement to these Mobile Devices Terms.</li><li><strong>Application Use.&nbsp;</strong>Everisamting grants you the right to use the Application only for your personal use. You must comply with all applicable laws and third party terms of agreement when using the Application (e.g. your wireless data service agreement). The Application may not contain the same functionality available on the www.everisamting.com website. &nbsp;Your download and use of the Application is at your own discretion and risk, and you are solely responsible for any damages to your hardware device(s) or loss of data that result from the download or use of the Application.</li><li><strong>Intellectual Property - Applications.&nbsp;</strong>Everisamting owns, or is the licensee to, all right, title, and interest in and to its Applications, including all rights under patent, copyright, trade secret, trademark, and any and all other proprietary rights, including all applications, renewals, extensions, and restorations thereof. You will not modify, adapt, translate, prepare derivative works from, decompile, reverse-engineer, disassemble, or otherwise attempt to derive source code from any Application and you will not remove, obscure, or alter Everisamting’s copyright notice, trademarks or other proprietary rights notices affixed to, contained within, or accessed in conjunction with or by any Everisamting Application.</li><li><strong>Prohibited Countries Policy and Foreign Trade Regulation - Applications.&nbsp;</strong>Everisamting Applications or their underlying technology may not be downloaded to or exported or re-exported: (a) into (or to a resident or national of) Burma (Myanmar), Cuba, Iraq, Iran, Libya, North Korea, Sudan, Syria, or any other country subject to United States embargo; (b) to anyone on the US Treasury Department’s list of Specially Designated Nationals or on the US Commerce Department’s Denied Party or Entity List; and (c) to any prohibited country, person, end-user, or entity specified by US Export Laws. When using a Everisamting Application, you are responsible for complying with trade regulations and both foreign and domestic laws (e.g., you are not located in a country that is subject to a US Government embargo, or that has been designated by the US Government as a “terrorist supporting” country, and you are not listed on any US Government list of prohibited or restricted parties).</li><li><strong>Additional Terms.&nbsp;</strong>Additional terms and conditions that apply to you based on the mobile device the Application is installed on:</li></ol><p><strong>iOS – Apple</strong></p><p>&nbsp;</p><p>1.&nbsp;&nbsp; &nbsp;These Mobile Devices Terms are an agreement between you and Everisamting, and not with Apple. Apple is not responsible for the Application and the content thereof.</p><p>2.&nbsp;&nbsp; &nbsp;Everisamting grants you the right to use the Application only on an iOS product that you own or control and as permitted by the Usage Rules set forth in the App Store Terms of Service.</p><p>3.&nbsp;&nbsp; &nbsp;Apple has no obligation whatsoever to furnish any maintenance and support services with respect to the Application.</p><p>4.&nbsp;&nbsp; &nbsp;Apple is not responsible for the investigation, defence, settlement, and discharge of any third party intellectual property infringement claim.</p><p>5.&nbsp;&nbsp; &nbsp;Apple is not responsible for addressing any claims by you or any third party relating to the Application or your possession and/or use of the Application, including but not limited to: (a) product liability claims; (b) any claim that the Application fails to conform to any applicable legal or regulatory requirement; and (c) claims arising under consumer protection or similar legislation.</p><p>6.&nbsp;&nbsp; &nbsp;In the event of any failure of the Application to conform to any applicable warranty, you may notify Apple, and Apple will refund the purchase price, if applicable, for the Application to you; and to the maximum extent permitted by applicable law, Apple will have no other warranty obligation whatsoever with respect to the Application.</p><p>7.&nbsp;&nbsp; &nbsp;Apple and Apple’s subsidiaries are third party beneficiaries of these Mobile Devices Terms, and, upon your acceptance, Apple as a third party beneficiary thereof will have the right (and will be deemed to have accepted the right) to enforce these Mobile Devices Terms against you.</p><p>&nbsp;</p><p><strong>Windows – Microsoft</strong></p><p>&nbsp;</p><p>1.&nbsp;&nbsp; &nbsp;These Mobile Devices Terms are an agreement between you and Everisamting, not Microsoft. The terms of use and privacy policies of Microsoft and, where applicable, the network operators that provide billing services for the Windows Phone Marketplace do not apply to your use of the Application.</p><p>2.&nbsp;&nbsp; &nbsp;You may install and use one (1) copy of the Application on up to five (5) devices you personally own or control and which are affiliated with the Windows Live ID associated with your Windows Marketplace account. You may not install or use a copy of the Application on a device you do not own or control.</p><p>3.&nbsp;&nbsp; &nbsp;Microsoft, your device manufacturer, and (if applicable) your wireless carrier are not responsible for providing support services for the Application.</p><p>4.&nbsp;&nbsp; &nbsp;Microsoft, the wireless carriers over whose network the Application is distributed (if applicable), and each of their respective affiliates and suppliers (collectively, “Disclaiming Distributors”) give no express warranty, guarantee, or conditions under or in relation to the Application. To the extent permitted under your local laws, the Disclaiming Distributors exclude any implied warranties or conditions, including those of merchantability, fitness for a particular purpose, and non-infringement.</p><p>5.&nbsp;&nbsp; &nbsp;You, and not the Disclaiming Distributors, bear the risk of using the Application (even if the Disclaiming Distributors have been advised of the possibility of damages to you). You may have additional consumer rights under your local laws which these Mobile Devices Terms cannot change.</p><p>6.&nbsp;&nbsp; &nbsp;To the extent not prohibited by law, you will not seek to recover any consequential, lost profit, special, indirect, or incidental damages from any Disclaiming Distributor.</p><p>&nbsp;</p>', 'uploads/banners/GwZtV6UMxXFp4Ffk1vYwXg5YYNmhemKcPGryq6t7.png', 'https://youtu.be/s7wmiS2mSXY', '<p>Welcome to everisamting.com! Our website is dedicated to providing top quality platform to buy and sell in Vanuatu.</p><p>Founded in 2023 by people here in Vanuatu, we have been serving the Vanuatu community for over 40 years in different areas. Our team is made up of highly skilled and knowledgeable individuals who are passionate about what they do.</p><p>At everisamting.com, customer satisfaction is our top priority. We strive to go above and beyond to ensure that every one of our clients is completely satisfied with their experience.</p><p>Thank you for visiting our website. We hope to have the opportunity to serve you and fulfill all of your buying and selling needs</p>', NULL, '<p><strong>Everisamting User Privacy Notice (Privacy Policy)</strong><br><br>Effective as at:19 November 2021<br><br><strong>Summary &amp; Contents</strong></p><figure class=\"table\"><table><tbody><tr><td><p>&nbsp;</p><p><br><strong>Scope and Consent</strong></p></td><td><p>&nbsp;(\'Everisamting\') is the operator of Everisamting.com (\'the Site\'). This Privacy Notice describes:</p><ul><li>the personal information we collect and how we use that information</li><li>when we might disclose your personal information</li><li>how we keep and protect your personal information</li></ul><p>The Privacy Notice applies to this Site and to any applications, services or tools (collectively \'Services\') where this Privacy Notice is referenced. By using our Services and/or registering for an account, you are accepting the terms of this Privacy Notice and our&nbsp;Terms of Use</p></td></tr><tr><td><p>&nbsp;</p><p><br><strong>Collection</strong></p></td><td>We collect, process and retain personal information from you and any devices (including mobile devices) you use when you:register for an account with us, use our Services, give us information on a web form, update or add information to your account, join community discussions, chats or dispute resolution or when you otherwise contact us</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Use and Retention</strong></p></td><td>We use your personal information to:provide and improve our Services or those of our related entities [such as Autotrader and CarsGuide - Carsguide Autotrader Media Solutions Pty Ltd] (\'Related Companies\'), give you a personalised experience on our sites or on any sites that are operated by our Related Companies, contact you, provide customer service, provide you with personalised advertising and marketing, including marketing from our Related Companies and other third parties, and detect, prevent and investigate fraud and/or other illegal activities.<br>&nbsp;<br>We keep personal information from active accounts as long as it is needed for our operations. We also keep personal information from closed accounts when we’re legally required to and also to stop fraud, collect outstanding fees, troubleshoot problems, help with investigations, enforce our&nbsp;Terms of Use&nbsp;and take other actions under applicable national laws</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Choice</strong></p></td><td>You choose how we use your personal information to communicate with you</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Access</strong></p></td><td>You can access and correct your personal information</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Disclosure</strong></p></td><td>We may share your personal information with Related Companies and third parties to provide you with our Services, to comply with the law, to enforce our policies, to enable our marketing and advertising activities and those of our Related Companies, or to prevent, detect, mitigate and investigate fraud or other illegal activities. We only share your personal information with our Related Companies to market and advertise their products and services which we believe will be of interest to you. We don’t give your personal information to other third parties for their marketing and advertising purposes unless you give us permission.</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Security</strong></p></td><td>We protect your information using technical and administrative security measures</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Important Information</strong></p></td><td>This section sets out some important information about your use of our Services</td></tr><tr><td><p>&nbsp;</p><p><br><strong>Questions or Complaints</strong></p></td><td>If you have a question or a complaint about this Privacy Notice or our privacy practices, you can write to: Everisamting AU Pty Ltd, C/- Marque Lawyers Level 4, 343 George Street, Sydney NSW 2000 Australia. If you are not satisfied with our response, you may contact the Office of the Australian Information Commissioner (Telephone +61 1300 363 992 or email enquiries@oaic.gov.au)</td></tr></tbody></table></figure><p><strong>Scope and Consent</strong></p><p><br>This Privacy Notice describes</p><ul><li>the personal information we collect and how we use that information</li><li>when we might disclose your personal information</li><li>how we keep and protect your personal information</li></ul><p>It applies to this Site and to any Services where this Privacy Notice is referenced.<br>By using our Services and/or registering for an account, you are accepting the terms of this Privacy Notice and our&nbsp;<a href=\"https://help.gumtree.com.au/articles/en_US/KB_Article/Gumtree-Terms-of-Use-AU?vgroup1=PKB&amp;c=PKB%3APolicies&amp;vcategory2=General_Policies&amp;s=\">Terms of Use</a>. If you do not provide the information we require, we may not be able to provide all of our Services to you.<br>Everisamting is responsible for the collection, use, disclosure, retention and protection of your personal information under our privacy standards and applicable national laws. Everisamting may transfer data to Related Companies as described in this Privacy Notice who may process and keep your personal information on servers in the European Union, United States and elsewhere in the world where our data centres are located. Where we disclose your information to third parties that are located overseas, or where your information is held in our overseas servers, we will take reasonable steps to ensure that your personal information is protected in accordance with law.<br><strong>What is Personal Information?</strong><br>\'Personal information\' is information or an opinion about an identified individual, or an individual who is reasonably identifiable, either from the information directly or from that information combined with other information that we have, or are likely to have, access to. Personal information doesn’t include de-identified, anonymous or aggregated information that can no longer be used to identify a specific person.<br><strong>Public Information?</strong><br>Public information is any information, including personal information, you share with a public audience, including personal information you publish on our Site. Public information is available to anyone on or off our Services and can be seen or accessed through online search engines, APIs, and offline media, such as on TV.<br><strong>Changes to this Private Notice</strong><br>We can change this Privacy Notice at any time by posting the updated terms to the Site. The updated terms automatically take effect 14 days after they are posted. We may announce any changes to this Privacy Notice on our Site and/or via email if we believe they are material.<br><br><strong>Collection</strong></p><p><strong>We collect information you give us including:</strong></p><ul><li><strong>When you register for an account&nbsp;</strong>Information such as your name, addresses, telephone numbers, email addresses or user ID (where applicable) when you register for an account with us</li><li><strong>When we verify you or your account&nbsp;</strong>we may collect and process information (as permitted by law) to authenticate you or your account, or to verify the information that you provided to us</li><li><strong>When you transact on or use our Services</strong>&nbsp;such as when you post an ad, reply to an ad, communicate with us or other users, information you provide for the Services that you use or during a transaction or other transaction-based content. We may also collect your financial information (such as credit card or bank account numbers) if you buy a feature from us or are required to pay fees to us</li><li><strong>When you engage with our community</strong>&nbsp;such as when you submit a web form or participate in community discussions or chats</li><li><strong>When you interact with your account&nbsp;</strong>such as updating or adding information to your account, adding items to alerts lists and saving searches. Sometimes you may also give us your age, gender, interests and favourites</li><li><strong>When you contact us&nbsp;</strong>such as through a web form, chat or dispute resolution or when we otherwise communicate with each other. We may also record our calls with you (if we have your consent to do so)</li><li><strong>When you submit your resume&nbsp;</strong>such as if you choose to submit your resume to advertisers on our site for consideration</li></ul><p><strong>We collect information automatically including:</strong></p><ul><li><strong>Information from the devices you use when interacting with us or our Services&nbsp;</strong>such as device ID or unique user ID, device type, ID for advertising and unique device token</li><li><strong>Information about your location</strong>&nbsp;such as geo-location<ul><li><strong>Google Maps:</strong>&nbsp;if you provide your business address when you create a listing, we may display the address on a map (Google Maps), in your respective listings. For this purpose, we transmit the address data to external service providers such as Google Ireland Limited for the use of Google Maps (please refer to&nbsp;<a href=\"https://policies.google.com/privacy\">Google\'s Privacy Notice</a>). If a user does not want their location details to be shown on a map in their respective listings, they can contact Everisamting customer service at any time at Everisamtingsupport@Everisamting.com</li></ul></li><li><strong>Computer and connection informations&nbsp;</strong>such as statistics on your page views, traffic to and from the sites, referral URL, ad data, your IP address, your browsing history and your web log information</li><li><strong>We collect information using cookies, web beacons and similar technologies including:</strong></li><li>Information about the pages you view, the links you click and other actions you take on our Services, or within our advertising or email content. For more information about our use of these technologies and how to control them, see our notice on&nbsp;Cookies, Web Beacons and Similar Technologies</li><li>Without limiting the general application of the Cookies Web Beacons and Similar Technologies Policy, a non-inclusive example of similar technologies we use and what we use them for can be found in the below table</li></ul><figure class=\"table\"><table><tbody><tr><td><strong>Systems, tools and vendors that utilise or set cookies&nbsp;or use other identifiers</strong></td><td>Purpose</td></tr><tr><td>Facebook<br>Criteo<br>Google Ads<br>Bing<br>Google Marketing Platform<br>Adform</td><td><strong>Remarketing&nbsp;</strong>(also known as retargeting) is the tactic of serving targeted ads to users who have already visited or taken action on our website or app. In terms of technical execution, remarketing is the process of using a javascript tag (known as a pixel) to place a cookie or similar technology in the user’s browser. The cookie or similar technology then informs a remarketing platform to serve specific display and search ads across other websites, search engine results pages or apps through an ad exchange, based on the pages or products the user has engaged with.</td></tr><tr><td>Facebook<br>Google Marketing Platform</td><td><strong>Marketing attribution</strong>&nbsp;is the process of identifying a set of user actions and marketing sources that contribute in some manner to a desired outcome and then assigning a value to each of these events. Cookies or a similar technology are used to remember the user action or marketing source so it can then be attributed as the source of said desired outcome.</td></tr><tr><td>Google Analytics<br>Nielsen Digital Content Ratings<br>Integral Ad Science<br>Confiant<br>&nbsp;</td><td>Digital analytics&nbsp;is the measurement, collection, analysis and reporting of web and app data for the purposes of understanding and optimising web and app usage. Cookies or a similar technology anonymously measure the number of visits and visitors to the website or app and understand the user’s website or app experience and segment those that are either new to the website or app from those that are returning.<br>Nielsen:<br><a href=\"https://www.nielsen.com/us/en/legal/privacy-statement/digital-measurement/\">Click here</a> to learn more about Nielsen. If you’d like to opt-out, please&nbsp;<a href=\"https://priv-policy.imrworldwide.com/priv/browser/cookie-policy-de-en.html?optout=1\">click here</a>.</td></tr><tr><td>Adobe Audience Manager</td><td><strong>Data Management Platforms</strong>&nbsp;(or DMP) is a tool used to consolidate or disperse data across first, second and third-party channels. It uses cookies or a similar technology to manage the segmentation and identity definition of a user to then provide cohesive audience targeting across all of the various channels where we might be engaging with a consumer.</td></tr><tr><td>Google Ad Manager<br>Google Adsense<br>Magnite (formerly Rubicon Project &amp; Telaria)<br>Xandr (formerly AppNexus)<br>Triplelift<br>Adyoulike<br>Pubmatic<br>Index Exchange<br>OpenX<br>Smaato<br>Rokt</td><td><strong>Onsite advertising</strong>&nbsp;is the display of messages from selected partners via an ad serving platform utilising cookies or a similar technology to provide both general and personalised advertisements based on a user’s behaviours across the web.</td></tr><tr><td>Publisher Provided ID<br>LiveRamp<br>Infosum<br>UID2<br>Network Advertising Initiative<br>Your Ad Choices</td><td><p><strong>Identity partners &amp; Interest Based Advertising</strong></p><p>Publisher Provided IDs [PPID] are encrypted identifiers that we [ESV] use to provide more relevant advertising to you [the user]. These identifiers are shared with our partners like Google, however, they cannot be decrypted to reveal personal identifiable information. You can opt-out from sharing your PPID here. When a user opts out of PPID usage for advertising, or deletes their account with us, we immediately stop sending our partners any PPID details associated with that user and all data is subsequently deleted from our partner’s systems.<br><br>LiveRamp provides an Authenticated Traffic Solution(ATS) for people-based advertising. ATS enhances addressability for publishers while providing visibility and control for individuals. ATS allows publishers to match user data with a LiveRamp IdentityLink in real-time, enabling people-based advertising on authenticated, cookieless inventory across the internet. Click&nbsp;here&nbsp;to learn more about LiveRamp. If you’d like to opt-out, please click&nbsp;here.</p><p>Our trusted advertising partners using the UID2 identifier are committed to delivering relevant advertising that also respects your choice.&nbsp; Advertising enables access to your favourite content across the internet. If you’d like to opt-out, please click &nbsp;here.</p><p>The online advertising industry provides websites from which you may opt out of interest-based advertising from other companies that participate in industry self-regulatory programs. See the NAI and Adchoices consumer web choices for more detail and refer here to learn more how to opt out of identifiers provided by mobile devices.</p></td></tr><tr><td>Liberty (propriety)<br>Labs (propriety)<br>Optimizely</td><td><strong>Experience Optimization platforms</strong>: we use a combination of internal and<strong>&nbsp;</strong>enterprise platforms to test variant user experiences and make our site and app experiences more rewarding for visitors.</td></tr></tbody></table></figure><p>Information we collect from other resources including:<br><br><strong>Information we get from our Related Companies</strong>&nbsp;which we use in order to provide you with value-added services as well as market our Services to you which may be of interest to you, for instance, where we may be able to offer you services that you appear interested in but are not available from our Related Companies. We may also use your personal information that we have collected from our Related Companies in order to manage your account, run internal analytics and develop business strategies across our associated brands</p><ul><li>Information we get from third parties:&nbsp;&nbsp;which we may use to supplement your account information. For example, we may collect and use demographic information that is publicly available, additional contact information, credit check information and information from credit bureaus, as allowed by applicable national laws</li><li><strong>Information from social media sites</strong>&nbsp;when you use those sites to register, share information or connect to your account. Those sites may automatically give us access to some personal information they hold about you (e.g., content you viewed, content you liked, and information about the advertisements you were shown or clicked on, etc.). If you give us access to any account with video content, we may share your video viewing with, or collect information about your video viewing from, third-party social media sites for at least two years or until you withdraw consent. You control the personal information we have access to through your privacy settings on the social media site and the permissions you give us when you grant us access. When you grant us access to information held by social media sites you agree that we may collect, use and retain it in accordance with this Privacy Notice</li><li><strong>Information other users may provide about you</strong>. If another user gives us information about you, they must tell you about our collection, use, disclosure and retention policies before giving us the information. They must also get your explicit consent before giving us your information</li></ul><p><strong>Use and Retention</strong></p><p><br><strong>We use your personal information to provide, improve and personalise our Services</strong><br>Your personal information allows us to:</p><ul><li>Provide you with access to and use of our Services as well as access to your history, internal messages and other features we may provide</li><li>Offer you site content that includes items and services that you may like</li><li>Provide you with credit offers and opportunities on behalf of our Related Companies and their financial institution partners. However, we don’t share financial information without your explicit consent</li><li>Customise, measure and improve our Services and those of our Related Companies</li><li>Provide other services requested by you as described when we collect the information, including those of our Related Companies if applicable</li><li>To provide you with location-based services (such as advertising, search results and other personalised content)</li></ul><p><strong>We use your personal information to contact you about your account:</strong><br>We may contact you via Everisamting My Messages, email, telephone, SMS messages or postal mail:</p><ul><li>To give you customer support about your account such as to troubleshoot problems, to resolve a dispute, to collect fees or monies owed to us, or to get your opinion through surveys</li><li>For other reasons such as to enforce our&nbsp;Terms of Use&nbsp;or policies and any other agreement we may have with you</li></ul><p><strong>We use your personal information too personalise our advertising and marketing, including to:</strong></p><ul><li>Personalise, measure and improve our advertising and that of our Related Companies</li><li>Contact you, either via email, telephone, SMS text messages or postal mail to offer you discounts and special promotions and to let you know about our Services and those of our Related Companies (if you have consented to this contact). Message and data rates may apply</li><li>Deliver targeted marketing, service updates and promotional offers, including in relation to our Related Companies</li></ul><p><strong>We use your personal information for legal compliance reasons, including to:</strong></p><ul><li>Prevent, detect, mitigate and investigate fraud, security breaches, potentially prohibited or illegal activities</li><li>Enforce our Privacy Notice, our&nbsp;Terms of Use&nbsp;or other policies</li></ul><p>Retention of personal informations:<br>If your account is active, we will keep your personal information as long as we need it for our operations. We may also keep personal information from closed accounts to comply with national laws, stop fraud, collect fees owed, assist with any investigation, enforce our&nbsp;Terms of Use&nbsp;and take other actions under applicable national laws. If we no longer need your personal information, we securely dispose of it.<br><br><strong>Choice</strong></p><p><br><strong>Marketing Communications.&nbsp;</strong>If you don’t want to receive marketing communications from us, you can unsubscribe via the link in the email you received. Registered users may also unsubscribe via the communication preferences options in their profiles.<br><br><strong>Push Notifications.&nbsp;</strong>Upon download of certain Services, you are provided the option to opt into receiving push notifications from Everisamting on your device and within the application. We send you push notifications from time-to-time to (a) inform you of Service-related messages, (b) communicate messages from others in the Everisamting community and (c) update you about any events or promotions that we or our Related Companies may be running. If you no longer wish to receive notifications from us, you can, where applicable, change your preferences by logging into your account or by disabling notifications in your device settings. To ensure you receive proper notifications, we will need to collect certain information about your device such as operating system and user identification information.<br><br><strong>Targeted Advertising.</strong>&nbsp;If you want to learn more about targeted advertising (also known as behavioural advertising), and turn on or off individual companies for online behavioural advertising, you can do so on&nbsp;<a href=\"http://www.youronlinechoices.com.au/\">www.youronlinechoices.com.au</a>.<br><br><strong>Access</strong></p><ul><li>You can see, review and change your personal information by signing in to your account. Please update your personal information immediately if it changes or is inaccurate</li><li>Once you make a public posting, you may not be able to change or remove it. If you ask us to, we will close your account and remove your personal information from view as soon as reasonably possible, based on your account activity and as required under applicable national laws</li></ul><p>We will honour your right to request access to, or modification or deletion of, your personal information. We may have the right to withhold that access or refuse to modify or erase your personal information under applicable national laws, but we will give you reasons if we do so. To contact us about access and to find out if any fees apply, please contact&nbsp;Customer Service&nbsp;or by using the contact details above.<br><br><strong>Disclosure</strong></p><p><br><strong>We disclose your information to our Related Companies, who may use it to:</strong></p><ul><li>provide joint content, services and marketing (like registration, account management, transactions and customer support)</li><li>help detect and stop possible fraud and illegal acts, violations of our&nbsp;Terms of Use, and data security breaches</li><li>offer you personalised advertising</li><li>guide decisions and business strategy about their products, sites, applications, services, tools and marketing communications</li></ul><p><strong>We may disclose your information to third-parties:</strong></p><ul><li>third party service providers who help us provide our Services, payment processing services, assist us in providing customised advertising, help us with the prevention, detection, mitigation and investigation of potentially illegal acts, violations of our&nbsp;Terms of Use, fraud and/or security breaches, bill collection, affiliate and rewards programs and other business operations</li><li>third party financial institution partners who may offer financial products to you, for them to provide joint content and services (such as registration, transactions and customer support). These third party financial institution partners will use your personal information to send you marketing communications only if you have requested their services</li><li>other third parties when you have given consent to share your information via Everisamting</li><li>Everisamting uses Nielsen software to measure and analyse usage of our website. To learn more about the information that Nielsen software may collect and your choices with regard to it, please see the&nbsp;<a href=\"http://www.nielsen.com/digitalprivacy\">Nielsen Digital Measurement Privacy Policy</a></li></ul><p><strong>We may disclose your information to law enforcement and and other parties in connection with the law, including:</strong></p><ul><li>law enforcement or governmental agencies, or authorised third-parties, in response to a verified request regarding a criminal investigation, alleged or suspected illegal activity, or any other activity that may expose us, you or any of our users to legal risk</li><li>participants of the Everisamting \'Verified Rights Owners Program\' under confidentiality agreement, if we decide that it is necessary to disclose that information in connection with an investigation of fraud, intellectual property infringement, piracy or other unlawful activity</li><li>credit agencies or bureaus as authorised by applicable national laws</li><li>third parties commencing, or involved in, a legal proceeding if they provide us with a subpoena, court order or similar legal document</li><li>other third parties to comply with our legal requirements, enforce our&nbsp;Terms of Use, respond to claims that a listing or other content violates the rights of others, or if we otherwise believe in good faith that the disclosure is needed to prevent imminent physical harm, harm to property, financial loss or to report suspected illegal activity</li></ul><p>Change of ownership</p><p><strong>If we were to merge with or be bought by another company, we may share information with them in accordance with our privacy standards. The new combined entity would comply with this Privacy Notice. If your personal information is to be collected, used, disclosed or retained for any purposes not covered in this Privacy Notice, you will receive advance notice of any changes to the processing of your personal information.</strong></p><p>Security<br>&nbsp;</p><p><br>We protect your information using technical and administrative security measures. Our safeguards include firewalls and data encryption, physical access controls to data centres and information access authorisation controls. If you believe your account has been abused, please contact&nbsp;Customer Service.<br><br><strong>Important Information</strong><br>&nbsp;</p><p><strong>Social login</strong><br>When you use social login:</p><ul><li>If you sign into your social network account using the same email that you previously used to register for an account with us, you will access your existing account with us</li><li>If you sign into your social network account using an email address that we don’t recognise in our systems, a new account will be created in our systems for you</li></ul><p>You may use social login or regular sign in each time you login into your account with us. If you use regular sign in but a password has not been issued to you (because you registered through social login) you need to get a password through the password reset flow.</p><p>When you use social login the \'keep me signed in\' policies of the social network provider apply. We do not control those policies. For your safety we recommend that you:</p><ul><li>Don’t use social login if you are accessing our Services using a public or shared device</li><li>Visit your social network provider site to learn about their sign in policies and your options</li></ul><p><strong>Unwanted or threatening email</strong> We do not tolerate abuse of our Services. You do not have permission to add other users to your mailing list, call or send SMS messages for commercial purposes, even if a user bought something from you, unless the user has given their explicit consent. Sending unwanted or threatening email and SMS messages is against our&nbsp;Terms of Use. To report spam or spoof emails please contact&nbsp;Customer Service.</p><p><strong>Third party privacy practices</strong><br>This Privacy Notice addresses only the use and disclosure of personal information we collect from you. If you disclose your information to others, or if you are directed to a third party website, their privacy notices and practices will apply.<br>We can’t guarantee the privacy or security of your information once you provide it to a third party. You should check the privacy and security policies of your trading partner before entering into a transaction and choosing to share your information, even when dealing with buyers or sellers on our site.</p><p><strong>Questions or Complaints</strong></p><p><br><br>For questions about this Privacy Notice or our privacy practices you can contact us at:&nbsp;</p><ul><li><a href=\"mailto:Info@Everisamting.com\">Info@Everisamting.com</a></li></ul><p>&nbsp;</p>', NULL, NULL, 'info@everisamting.com', 'Port Vila, Vanuatu', NULL, NULL, NULL, NULL, 'Praesent Finibus Dictum Nisl Sit Amet Vulputate. Fusce A Metus Eu Velit Posuere Semper A Bibendum Ante. Donec Eu Tellus Dapibus, Semper Orci Eget, Commodo Lacu Praesent Ullamcorper.', 'Lorem Ipsum Dolor Sit Amet, Consectetur Adipiscing Elit. Etiam Commodo Vel Ligula.', 'Class Aptent Taciti Sociosqu Ad Litora Torquent Per Conubia Nostra, Per Inceptos Himenaeos.', 'Class Aptent Taciti Sociosqu Ad Litora Torquent Per Conubia Nostra, Per Inceptos Himenaeos.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h2><strong>What is not allowed on Everisamting?</strong></h2><p><br>Updated 24th December 2022<br><br>The list below details what can\'t be posted on Everisamting in either offering or wanted ads:</p><ol><li>Alcoholic beverages</li><li>Blood, body parts and bodily fluids, or offers of humans for sale, including offers or requests for adoption or surrogacy</li><li>Burglary tools</li><li>Counterfeit products, replicas or knock-off brand name goods</li><li>Electronic surveillance equipment</li><li>Embargoed goods</li><li>Endangered or protected species, or any part of any endangered or protected species</li><li>Prostitution and escort services that offer sex, sexual favours, sexual actions or sexual services in exchange for anything</li><li>Fireworks, destructive devices and explosives</li><li>Government and transit badges, uniforms, IDs, documents and licenses</li><li>Hazardous materials including but not limited to radioactive, toxic and explosive materials</li><li>Identity documents, personal financial records and&nbsp;personal information</li><li>Illegal drugs, controlled substances, substances and items used to manufacture&nbsp;drugs and controlled substances, items designed only to help someone take drugs and drug paraphernalia</li><li>Nitrous oxide products, including but not limited to nitrous oxide canisters, bulbs, nangs and cream chargers</li><li>Illegal items and services, and items which encourage or facilitate illegal activity</li><li>Illegal telecommunication and electronics equipment such as access cards, password sniffers, radar scanners, traffic signal control devices or cable descrambler</li><li>Items issued to any Armed Force that have not been disposed of in accordance with that country\'s demilitarization policies</li><li>Lottery tickets, sweepstakes entries and slot machines</li><li>Material, pictures and images that are obscene, pornographic, adult in nature, contain nudity or are harmful to minors</li><li>Material that infringes copyright, including but not limited to software or other digital goods which you are not authorized to sell</li><li>New merchandise or services from network marketing companies, work-from-home, independent franchisees or distributors, or similar representatives</li><li>Personal information or mailing lists. We do not accept the sale of bulk email, Internet Protocol (IP), Instant Messenger (IM), or mailing lists that contain names, addresses, phone numbers, or other personal identifying information. Any tools or software designed predominantly to send unsolicited commercial messages (UCE or \"spam\") are also not permitted.</li><li>Selling or offering services for supplements/medicine general or pharmaceutical</li><li>Prescription or non-prescription drugs and devices, drugs that make false or misleading treatment claims, or treatment claims that require therapeutic goods administration \"<a href=\"http://www.tga.gov.au/\">TGA</a>\" approval</li><li>Commercial tanning units or commercial tanning services wanted or offered</li><li>Offensive material</li><li>Pesticides or hazardous materials</li><li>Plants and insects that are restricted or regulated</li><li>Recalled items, banned products or products that do not meet the mandatory product safety standards (for items recalled in Australia and information on product safety bans and mandatory standards, please visit:&nbsp;<a href=\"https://www.productsafety.gov.au/\">www.productsafety.gov.au</a>).</li><li>Stocks and other securities including Bitcoins and related mining equipment</li><li>Stolen property</li><li>Tobacco products and related items, including e-cigarettes</li><li>Used cosmetics</li><li>Used undergarments</li><li>Used or rebuilt batteries or batteries containing mercury</li><li>Weapons and related items (including, but not limited to firearms, firearm accessories, parts and magazines, ammunition, paintball guns, gel blaster guns, BB and pellet guns, , tear gas, tasers, stun guns, switchblade knives, martial arts weapons, archery and/or bow and arrow equipment)</li><li>Ivory, rhino horn or any animal parts or&nbsp;hunting trophies listed in the CITES 1 guidelines</li><li>Votes in elections administered by the Australian Electoral Commission or state-based Electoral Commission</li><li>Census or other survey papers issued by the Australian Bureau of Statistic</li><li>Electric dog collars (Training E-Collar, Shock Collar, Anti Bark Collar)</li></ol><p>&nbsp;</p>', NULL, NULL, 'Coming Soon', 'We are hardly trying to launch our website', 'Under Construction', 'Our website is under construction :)', 'Opps! Page Not Found!', 'We didn\'t find the page for you. Please go back to home page.', 'frontend/images/bg/error.png', 'Opps! Page Not Found!', 'We didn\'t find the page for you. Please go back to home page.', 'frontend/default_images/error-banner.png', 'Opps! Page Not Found!', 'We didn\'t find the page for you. Please go back to home page.', 'frontend/default_images/error-banner.png', '2022-08-19 23:31:12', '2023-01-14 10:14:05');
