"color: red;\">Carnival Luminosa</a></div>&nbsp;<div id=\"div-times-passengers-4\" class=\"resp-override psovde-times-passengers\" style=\"padding: 0px; margin: 0px; border: 0px; vertical-align: top; background-repeat: no-repeat; display: inline-block; width: 313px;\"><div class=\"psovde-times\" style=\"padding: 0px; margin: 0px 5px 0px 0px; border: 0px; vertical-align: top; background-repeat: no-repeat; font-size: 12px; display: inline-block; width: 158px;\">a 0800 d 1700</div>&nbsp;<div class=\"psovde-passengers\" style=\"padding: 0px; margin: 0px; border: 0px; vertical-align: top; background-repeat: no-repeat; font-size: 12px; display: inline-block; width: 150px;\">2260</div></div></div>', '2023-02-23', '08:00:00', '17:00:00', '2023-02-23', 'Pacific/Efate', 0, 'uploads/events/1675500144_63de1a70ad684.jfif', '[\"49\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 08:42:24', NULL, NULL, NULL),
(7, 53, 'Father Lini Day', 'father-lini-day', 'When is Chiefs Day?\r\n\r\nCustom Chiefs Day is a public holiday in the Republic of Vanuatu on March 5th each year.\r\n\r\nThis is a day to commemorate and preserve the traditional tribal customs observed on many islands.', '<h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">History of Father Walter Lini Day</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">A former Anglican priest, Father Walter Lini became the first prime minister of the newly independent country of Vanuatu in 1980.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">His term in office was controversial at times. He held socialist views that he believed matched his Christian values. He didn\'t hold back on admonishing large western nations such as France, opposing their nuclear testing, and America, who had a large naval presence in the region. He also established relations with the Communist Bloc, Libya, Cuba and Vietnam which further irritated Europe and the United States.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">He provided support to the independence movement in New Caledonia and supported the independence of East Timor from Indonesia control.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Lini also pushed for what he called \"Melanesian socialism\" - a system based on the traditional Polynesian idea that a people\'s land is owned in common.&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Lini left office in 1991 and passed away on February 21st 1999.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Father Walter Lini Day has been a public holiday in Vanuatu since 1999</p>', '2023-02-21', NULL, NULL, '2023-02-21', 'Pacific/Efate', 1, 'uploads/events/1675506625_63de33c10e18a.png', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 10:30:25', '2023-02-04 10:36:00', NULL, 2),
(8, 53, 'Chiefs Day', 'chiefs-day', 'When is Chiefs Day?\r\nCustom Chiefs Day is a public holiday in the Republic of Vanuatu on March 5th each year.\r\n\r\nThis is a day to commemorate and preserve the traditional tribal customs observed on many islands.', '<h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">History of Chiefs Day<br></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Vanuatu is an archipelago of over 80 islands in the South Pacific Ocean. Many of these islands have resisted European and Western influences and still live according to traditional customs. This includes a system where the tribes are still ruled by chiefs.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Though the customs may differ from island to island, the chief is recognized as the uppermost figure in a community.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">&nbsp;In 1977 a National Council of Chiefs (Malvatu Mauri) was set up by the government to advise and propose ways to ensure the preservation of traditional ways of life through Vanuatu. One outcome was the establishment of this public holiday on March 5th to recognize the commitment and prominent role of the chiefs.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">On this day, almost all the islands in Vanuatu will mark the day with local food, traditional singing and dances.</p>', '2023-03-05', NULL, NULL, '2023-03-05', 'Pacific/Easter', 1, 'uploads/events/1675506817_63de348115fdd.png', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 10:33:37', NULL, NULL, NULL),
(9, 53, 'Good Friday', 'good-friday', 'When is Good Friday?\r\n\r\nMany countries observe Good Friday as a national holiday on the Friday before Easter. The day commemorates the crucifixion and death of Jesus Christ.', '<h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">What is Good Friday?<br></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The most important events in Christianity are the death and later resurrection of Jesus Christ, who Christians believe is the Son of God, and whose life and teachings are the foundation of Christianity.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">After the last supper, Jesus was arrested in the Garden of Gethsemane, put on trial, sentenced to death. He was then tied and nailed by the wrists and feet to a large wooden cross and left to die. This is why the cross is used as a symbol of the Christian faith.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Good Friday is a day of mourning. During special Good Friday services Christians meditate on Jesus\'s suffering and death on the cross, and what this means for their faith.</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">Why is it called \'Good Friday\'?</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">At first glance, it seems a strange name for a day that marked such a terrible event as a crucifixion, but when we look at the origin of the name it becomes clearer... or it would if there was one origin that people could agree on. As it stands, you can take your pick from the following:</p><ul class=\"list-bullets\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51);\"><li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline; position: relative;\">Some say it comes from the use of \"Good\" as an adjective applied to the day, which is an Old English synonym for \"holy.\"</li><li style=\"margin: 0px; padding: 0px 0px 0px 20px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline; position: relative;\">Others believe it stems from a corruption of the word \"God,\" in much the same way that \"Good Bye\" comes from the phrase \"God be with ye.\" So the name may be derived from \'God\'s Friday\'.</li><li style=\"margin: 0px 0px 15px; padding: 0px 0px 0px 20px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline; position: relative;\">Undoubtedly most Christians perceive the day as \"good\" because the message of Easter is of Christ\'s victory over sin, death, and the devil. Indeed, the New Testament is also known as the Gospel, which is Greek for \'Good News\'.</li></ul><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Also, it also worth noting that this confusion over the name is mainly confined to Western European and North American Christians. Eastern Orthodox Christians call it \"Great and Holy Friday. Around the rest of the world, it\'s known as Holy Friday in most Latin nations, \'Great Friday\' by the Slavic peoples, \"Friday of Mourning\" in Germany and \"Long Friday\" in Norway.</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">Good Friday Traditions</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Many Church services are held in the afternoon, usually between noon to 3pm, to remember the hours when Jesus was crucified on the cross.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Some churches observe the day by re-enacting the process of the cross in the rituals of stations of the cross, which depicts the final hours of Jesus\' life. Other churches may participate in Veneration of the Cross, a short ceremony in which Christians kneel before the cross and affirm their faith.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">In Jerusalem, Christians follow in Jesus\' footsteps and walk Via Dolorosa, the traditional path that led to the site of the crucifixion. Many who participate try to ritually bear the same weight Jesus did by carrying crosses on their backs.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Though it\'s not a public holiday in the Vatican or Italy, the Pope will say a mass at the Vatican before leads an annual public prayer of the Stations of the Cross at the Colosseum in Rome. A procession is then made to the Palatine Hill, accompanied by a huge cross covered in burning torches.&nbsp;</p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 20px; line-height: 34px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">Alfombras in Central America</h3><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">In some Central American countries, including Guatemala, El Salvador and Honduras, the streets are decorated with vividly hued designs along the route of Good Friday processions. The tradition of creating these “alfombras,” Spanish for carpet or rug, originated in Spain’s Andalusia region. The practice crossed the pond with missionaries more than 400 years ago. The patterns often depict religious or natural images, created from brightly coloured sawdust. Alfombras are not meant to endure. The patterns disappear beneath the feet of the marchers and spectators.</p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 20px; line-height: 34px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">Hot Cross Buns</h3><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">A traditional Good Friday treat in the UK, Canada and Australia. Only available at this time of year, these sweet buns are made from a yeast dough augmented with raisins, currants and sometimes a little citron. They’re decorated with a cross made of light frosting, two strips of plain dough, or just a knife imprint. The hot cross buns tradition is savoured by cultures around the world, going back to at least the 16th century when Queen Elizabeth I is said to have forbidden their sale except on Good Friday, Christmas or for burials. The last two occasions have fallen by the wayside: Once Good Friday is over, you’re unlikely to see the treats until next year.</p>', '2023-04-07', NULL, NULL, '2023-04-07', 'Pacific/Efate', 1, 'uploads/events/1675507285_63de3655d7159.png', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 10:41:26', NULL, NULL, NULL),
(10, 53, 'Easter Monday', 'easter-monday', 'When is Easter Monday?\r\nEaster Monday is a Christian holiday celebrated the day after Easter Sunday.\r\n\r\nFormerly, it was celebrated as Easter Week in many places but this was reduced to a one-day celebration in the 19th century.', '<h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">What is Easter?</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Easter (also called Pascha) is generally accounted the most important holiday of the Christian year, observed in March or April each year to celebrate the Resurrection of Jesus from the dead after his death by crucifixion (see Good Friday), which Christians believe happened at about this time of year, almost two thousand years ago. (Easter can also refer to the season of the church year, lasting for nearly two months, which follows this holiday and ends around Pentecost)</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">Orthodox Easter date</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Orthodox churches such as the Greek church, base their Easter date on the Julian calendar, while other Christians use the Gregorian calendar.</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">Why is it called Easter?</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The name Easter is derived from \'Ostara\' or \'Eostre\', a pagan goddess of fertility, whose feast was celebrated on the Vernal Equinox. The word East is also derived from her names, as is Oestrogen, the female hormone. In Saxon culture, the Hare was sacred to Ostara and the modern tradition of the Easter Bunny is a distant echo of that.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">However, In most languages other than English and German, the holiday\'s name is derived from Pesach, the Hebrew name of Passover, a Jewish holiday to which the Christian Easter is intimately linked, as the Gospel of John states that the last supper took place during a specific part of the Passover traditions.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Easter, therefore, depends on Passover not only for much of its symbolic meaning but also for its position in the calendar.</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Deciding on a date</span></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The dates when Easter is celebrated varies from year to year. Why is this different from another Christian holiday, such as Christmas day, which is always on Dec 25th?<br><br>The problem is that the Gospels are pretty vague on the date of Easter. Matthew, Mark and Luke indicate one date, whereas John indicates a different date. Another factor is that Easter celebrates the resurrection of Jesus. To early Christians, his return for a second time was imminent, therefore they didn\'t worry too much about dates.<br><br>As the centuries passed, this lack of clarity around the date meant there was no standard date for Easter. For example by the late Third Century, if you travelled around Europe, you could celebrate Easter several times in the space of a few weeks. In Alexandria, Easter was always April 25th; in Rome, it was April 18th and in parts of Gaul, it was celebrated on March 21st. In fact, in parts of Celtic Britain, the crucifixion was commemorated on a Thursday instead of a Friday.<br><br>It was only after several attempts to set a standard date for Easter, that the formula of the Alexandrian Church was accepted as the correct way to determine the date. With this method and a passing nod to the method of calculating Passover, Easter is the first Sunday after the first full moon whose 14th day is on or after the Vernal Equinox. (see f<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">or the accountants in the audience</em>&nbsp;below for the exact formula)</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The earliest date that Easter can be is March 22nd and the latest is April 25th.</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Easter Eggs</span></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Modern Easter celebrations revolve around eggs. They may be painted, rolled down hills or eaten if they are of the chocolate variety. The Christian tradition of an egg is an aid to represent rebirth and resurrection - new life being born from the egg. It\'s also been said that egg recalls the shape of the stone that rolled away on Easter Sunday form the tomb that held Jesus\' body.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">This egg tradition is almost certainly a distillation of a much older pagan custom celebrating spring. The ancient Persians celebrated their new year at the time of the vernal equinox by painting eggs.<br><br>Its adoption into the Christian traditions would have been quite seamless, as eggs are banned during the period of Lent preceding Easter - in fact in many households the last eggs before Easter would have been used to make Pancakes on Pancake Tuesday.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">If you’re looking for another way to enjoy eggs during the Easter season, check out Bessieres, France, on Easter Monday, when the locals cook up 15,000 eggs to create a giant omelette</p>', '2023-04-10', NULL, NULL, '2023-04-10', 'Pacific/Efate', 1, 'uploads/events/1675508305_63de3a51a6c26.jpg', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 10:58:25', NULL, NULL, NULL);
