(11, 53, 'Labour Day', 'labour-day', 'When is Labour Day?\r\nThis international holiday is observed on May 1st. It is most commonly associated as a commemoration of the achievements of the labour movement.', '<h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">History of Labour Day<br></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The first May Day celebrations focused on workers took place on May 1st 1890 after its proclamation by the first international congress of socialist parties in Europe on July 14th 1889 in Paris, France, to dedicate May 1st every year as the \"Workers Day of International Unity and Solidarity.\"</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The date was chosen due to events on the other side of the Atlantic. In 1884 the American Federation of Organized Trades and Labor Unions demanded an eight-hour workday, to come in effect as of May 1st 1886. This resulted in the general strike and the Haymarket (in Chicago) Riot of 1886, but eventually also in the official sanction of the eight-hour workday.</p><blockquote style=\"margin: 5px 0px 20px 15px; padding: 0px 0px 0px 20px; border-width: 0px 0px 0px 4px; border-top-style: initial; border-right-style: initial; border-bottom-style: initial; border-left-style: solid; border-top-color: initial; border-right-color: initial; border-bottom-color: initial; border-left-color: rgb(16, 119, 162); border-image: initial; font-style: italic; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; quotes: none; color: rgb(153, 153, 153);\"><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">The riots at Haymarket Square in Chicago had begun as peaceful demonstrations over the legal establishment of an eight-hour workday.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">At a protest rally on May 4th 1890, a bomb was thrown at the police as they tried to disperse the crowds, resulting in the deaths of several police officers and some civilians.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">Though the eight-hour workday was not fully adopted across America until the 20th century, the events in Chicago inspired similar protests across Europe, establishing May 1st as the day to recognise the rights of workers across the world.</p></blockquote><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">May 1st is celebrated as May Day in most countries around the world. In the United Kingdom and Ireland the bank holiday isn\'t fixed on May 1st but instead is observed on the first Monday of May.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">In the 20th century, the holiday received the official endorsement of the Soviet Union, and it is also celebrated as the Day of the International Solidarity of Workers, especially in some Communist states. Celebrations in communist countries during the Cold War era often consisted of large military parades with the latest weaponry being exhibited as well as shows of common people in support of the government.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Curiously (given the origin of the May 1st date), the United States celebrates Labor Day on the first Monday of September (May 1st is Loyalty Day, a legal but not widely recognized holiday in the United States). There is some suggestion that the reason for this was to avoid the commemoration of riots that had occurred in 1886. The adoption of May Day by communists and socialists as their primary holiday has been as another reason for the official resistance to May Day labor celebrations in America.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Canada, Australia, New Zealand, and the Netherlands also celebrate Labour Day on different dates; though that has to do with how the holiday originated in those countries.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">May Day has long been a focal point for demonstrations by various communist, socialist, and anarchist groups.</p><p><img src=\"https://static.officeholidays.com/images/content/may-day-map-01.gif\" alt=\"Labour Day around the World\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; height: auto; display: inline; width: auto; max-width: 100%; color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"></span></p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">May Day</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">May 1st was also a pagan holiday in many parts of Europe, Its roots as a holiday stretch back to the Gaelic Beltane. It was considered the last day of winter when the beginning of summer was celebrated.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">During Roman times, May 1st was seen as a key period to celebrate fertility and the arrival of spring. The Roman festival of Flora, the goddess of flowers and the season of spring, was held between April 28th and May 3rd.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Traditional English May Day rites and celebrations include Morris dancing, crowning a May Queen, and dancing around a Maypole; festivities which made it a popular seasonal celebration in medieval England.</p>', '2023-05-01', NULL, NULL, '2023-05-01', 'Pacific/Efate', 1, 'uploads/events/1675508935_63de3cc722ff1.jpg', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 11:08:55', NULL, NULL, NULL),
(12, 53, 'Ascension Day', 'ascension-day', 'When is Ascension Day?\r\nAscension Day is the 40th day of Easter and commemorates the ascension of Jesus into heaven 39 days after resurrection on Easter Sunday.', '<h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">What is Ascension Day?<br></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">You will find the Biblical accounts of the&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Ascension</span>&nbsp;in Matthew 28:16-20, Mark 16:19-20, Luke 24:50-53 and Acts 1:6-11.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">During the forty-day period before he ascended into heaven, it is believed that Jesus preached and intermingled with his apostles and disciples.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">According to tradition, Ascension Day was first celebrated in 68 AD, however the first written evidence of the&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Ascension Day Feast</span>&nbsp;occurred in 385 AD.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Today, Ascension Day is celebrated primarily by Catholics and Anglican Christians. According to the Western Christianity methods of calculating the dates of Easter, the earliest possible date for Ascension Day is April 30, the latest possible date is June 3.</p><h2 style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\">How is Ascension Day celebrated?</h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">Ascension Day celebrations include the following:</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);\">The Easter (Paschal) candle is put out.</p>', '2023-05-18', NULL, NULL, '2023-05-18', 'Pacific/Efate', 1, 'uploads/events/1675509196_63de3dcc54bce.jpg', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 11:13:16', NULL, NULL, NULL),
(13, 53, 'Children\'s Day', 'children\'s-day', 'When is Children\'s Day?\r\nChildren\'s Day, also called Pikinini Day, is a public holiday in this South Pacific nation on July 24th each year. Note that this holiday is not celebrated on June 1st, International Children\'s Day.', '<p><div class=\"clearfix\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; zoom: 1; color: rgb(51, 51, 51); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div itemprop=\"articleBody\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><h2 style=\"margin: 0px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 500; font-stretch: inherit; font-size: 24px; line-height: 30px; font-family: &quot;Open Sans&quot;, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(96, 96, 96);\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">History of Children\'s Day</span><br></h2><p style=\"margin: 0px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">Children\'s Day was first celebrated in the capital city of Port Vila in response to a recommendation from the United Nations Human Rights Committee on the Rights of the Child.</p><p style=\"margin: 0px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">This is a day to promote the welfare and well-being of children and also to celebrate children and what they contribute to society. The theme of the day changes from year to year, though the topic of fighting child abuse remains a perennial theme of the day.</p><p style=\"margin: 0px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">As a public holiday, it\'s a day for families to spend extra time together.</p><p style=\"margin: 0px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 24px; font-family: inherit; vertical-align: baseline;\">Children\'s Day takes place a week before Independence Day and the parades, concerts, public speeches, sports events, and other celebratory activities held to mark Children\'s Day are seen as marking the start of Vanuatu\'s national Independence week.</p></div>', '2023-07-24', NULL, NULL, '2023-07-24', 'Australia/Adelaide', 1, 'uploads/events/1675509793_63de4021e3b49.jpg', '[\"50\"]', 'null', 1, NULL, 1, NULL, '[]', 0, 0, NULL, NULL, '2023-02-04 11:23:14', NULL, NULL, NULL),
(14, 65, 'Best book event', 'best-book-event', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before.', '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p><p><br></p>', '2023-02-06', NULL, NULL, '2023-02-13', NULL, 1, 'uploads/events/1675593197_63df85ed07131.png', '[\"36\",\"46\"]', '[\"1\",\"6\"]', 1, NULL, 0, NULL, '[]', 1, 1, 'facebook.com', NULL, '2023-02-05 10:33:17', '2023-02-05 10:34:12', 65, 65),
